customElements.define("pyrabank-header",class extends HTMLElement{constructor(){super(),this.attachShadow({mode:"open"}),this.shadowRoot.innerHTML=this.template}get template(){return'\n    <style>\n      :host {\n        display: flex;\n        flex-direction: column;\n        background: var(--primary-color);\n        border-bottom: 1px solid rgba(0, 0, 0, 0.72);\n        padding: 12px 24px;\n        box-sizing: border-box;\n        height: var(--app-header-height);\n      }\n      \n      ::slotted(*) {\n        margin: 0;\n      }\n      \n      .flex {\n        flex: 1;\n      }\n    </style>\n\n    <slot name="top"></slot>\n    \n    <span class="flex"></span>\n    \n    <slot></slot>\n    \n    <span class="flex"></span>\n    \n    <slot name="bottom"></slot>\n\n    '}}),customElements.define("pyrabank-toolbar",class extends HTMLElement{constructor(){super(),this.attachShadow({mode:"open"}),this.shadowRoot.innerHTML=this.template}get template(){return'\n    <style>\n      :host {\n        --toolbar-height: 48px;\n        display: flex;\n        flex-direction: row;\n        align-items: center;\n        background: var(--dark-primary-color);\n        height: var(--toolbar-height);\n        padding: 0 8px;\n        background-image: url(assets/diamond.svg);\n        \n        background-color: var(--light-primary-color);\n      }\n      \n      .flex {\n        flex: 1;\n      }\n    </style>\n      <slot name="left"></slot>\n      <span class="flex"></span>\n      <slot></slot>\n      <span class="flex"></span>\n      <slot name="right"></slot>\n    '}});
